import LeftMenu from "../LeftMenu/LeftMenu"

function Header() {
  return(
    <header className="header">
        <LeftMenu />

        <div className="search">
          <input className="search-bar" placeholder="Search mail" />
        </div>
      </header>
  )
}

export default Header
